import styled from "styled-components";

const About = () => {
  return (
    <>
      <Container>
        <div
          style={{
            color: "aliceblue",
            width: "1500px",
            fontSize: "100px",
            textAlign: "center",
            padding: "16px",
          }}
        >
          About me
        </div>
      </Container>
    </>
  );
};

export default About;

const Container = styled.div`
  border: 5px solid skyblue;
  border-radius: 50px;
  max-width: 50%;
`;
